import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import style from '../assets/css/style.module.css';

const Home = () => (
    <div>
        <div className={style.header}>
            <Container>
                <h1 className={style.title}>Next.js + Bootstrap</h1>
                <p>Use this as a simple structure for a simple start to a simple site.</p>
                <p>Use isso como uma solução simples para iniciar um projeto do next com bootstrap</p>
            </Container>
        </div>
    </div>
)

export default Home
